            "inputData": {
                "vmo": "{{props.vmo}}",
                "viewModel": "{{data}}"
            },
            "deps": "js/SplmTableCellEditorService"
        }
    },
    "data": {},
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render",
        "onMount": "onMount"
    },
    "_viewModelId": "SplmTableCellEditor",
    "_uniqueViewModelId": "SplmTableCellEditor",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, splmTableCellEditorRenderFunction, undefined, ctxImportObj );

export default Component;
